import React, { useState } from 'react';
import { createStyles, withStyles } from '@material-ui/core/styles';
import Dialog from '@material-ui/core/Dialog';
import { FormControl, FormHelperText, InputLabel, Input } from '@material-ui/core';
import { blue } from '@material-ui/core/colors';

const styles = createStyles({
  avatar: {
    backgroundColor: blue[100],
    color: blue[600],
  },
});

export interface IProps {
    classes: any,
}

const LoginForm: React.FC<IProps> = props => {
    const { classes } = props;

    const [shouldDialogOpen, setShouldDialogOpen] = useState(true);

    const onClose = () => {
        setShouldDialogOpen(false);
    }

    return (
        <Dialog aria-labelledby="simple-dialog-title" open={shouldDialogOpen}>
            <FormControl>
                <InputLabel htmlFor="my-input">Email address</InputLabel>
                <Input id="my-input" aria-describedby="my-helper-text" />
                <FormHelperText id="my-helper-text">We'll never share your email.</FormHelperText>
            </FormControl>
        </Dialog>
    );
}

export default withStyles(styles)(LoginForm)
